import NavBar from '../nav.js'
import './style.css'

function GetStartedButton(props) {
    return <a className ='btn btn-primary' href="../signUp.js" >
        Get Started...
    </a>
}

function GettingStartedView(props) {
    return <div className="getting-started-container component-container hovered">

        <h1>Personal Finance Manger</h1>
        <GetStartedButton/>

    </div>
}

export default function LandingPage(props) {
    return <div className = "container">
        {/* this is only for TEST (the nav here) */}
        <NavBar 
            profile = ''
            makePlan = ''
            settings = ''
            expenseReport = ''/>

        <GettingStartedView/>

    </div>
}



